    def check_assignment(self, clause):
        satisfied = True
        for literal in clause:
            if literal < 0:
                if literal not in self.variables:
                    return False
                satisfied &= (not self.variables[literal])
            else:
                if literal in self.variables:
                    return False
                satisfied &= (self.variables[literal])
        return satisfied

