            if len(set(clause)) == 3 and len(set(clause))!= len(clause) and len(set(clause))!= 6:
                self.clauses.add(clause)
                if self.check_assignment(clause):
                    return True
                self.clauses.remove(clause)

    def solve(self, m: int, n: int, clauses: List[List[int]]):
        instances = []
        for _ in range(m):
            clauses = set(clauses[next(iter(clauses))])
            if len(clauses) >= 8:
                instances.append(clauses)

        for clauses in instances:
            self.find_instance(clauses)

        satisfiable_instances = [instance for instance in instances if self.check_assignment(instance)]
        if len(satisfiable_instances) == 0:
